import App from "./App";
import Login from "./Login/Login";
import { BrowserRouter, Link, Route, Routes, Switch } from 'react-router-dom';
function Rotas() {
    return (
        <BrowserRouter>
            <Routes>
                <Route element={<App/>} exact path="/" />
                <Route path="login" element={<Login/>} />
            </Routes>
        </BrowserRouter>

    )
}

export default Rotas
